CREATE TABLE IF NOT EXISTS word_type
(
    id SERIAL PRIMARY KEY NOT NULL,
    value VARCHAR(20)
);
 
CREATE INDEX IF NOT EXISTS index_word_type_on_value ON word_type (value);

CREATE TABLE IF NOT EXISTS word2
(
    id SERIAL PRIMARY KEY NOT NULL,
    noun_singular_default VARCHAR(40) NULL,
    noun_plural VARCHAR(40) NULL,
    verb_1_he_she_it VARCHAR(40) NULL,  
    verb_1_i_you_we_they VARCHAR(40) NULL,  
    verb_present_participle VARCHAR(40) NULL, 
    verb_2_past_tense VARCHAR(40) NULL, 
    verb_3_past_participle VARCHAR(40) NULL, 
    verb_irregular BOOLEAN NULL,
    add_adjectives VARCHAR NULL,
    form_adjective_comparative VARCHAR(40) NULL, 
    form_adjective_superlative VARCHAR(40) NULL, 
    id_word_type INT NULL,
    translate_define VARCHAR(255) NOT NULL,  
    group_factor VARCHAR(255) NULL,
    frequency INT NULL
);

