CREATE INDEX IF NOT EXISTS index_word_on_noun_singular_default ON word2 (noun_singular_default);
CREATE INDEX IF NOT EXISTS index_word_on_noun_plural ON word2 (noun_plural);
CREATE INDEX IF NOT EXISTS index_word_on_verb_1_he_she_it ON word2 (verb_1_he_she_it);
CREATE INDEX IF NOT EXISTS index_word_on_verb_1_i_you_we_they ON word2 (verb_1_i_you_we_they);
